import React from "react";

export default function ToDoList() {
  const [listPoints, setlistPoints] = React.useState(["vasketid", "indkøb"]);
    const addListItem = (textOfListItem)=>(
        setlistPoints([])
    )



  return (
      <>
    <ul>
      {listPoints.map(listPoint => (
        <li>{listPoint}</li>
      ))}
    </ul>
    <button onClick={()=>addListItem('item')}>Click me</button>
    </>
  );
}
